import React, { useRef, useState } from 'react';
import { motion } from 'framer-motion';
import emailjs from '@emailjs/browser';

const ContactModal = ({ isOpen, onClose }) => {
  const form = useRef();
  const [status, setStatus] = useState("Send Inquiry");

  if (!isOpen) return null;

  const handleContactSubmit = (e) => {
    e.preventDefault();
    setStatus("Sending...");

    // COPY THESE DIRECTLY FROM EMAILJS DASHBOARD
    const SERVICE_ID = "YOUR_SERVICE_ID"; 
    const TEMPLATE_ID = "YOUR_TEMPLATE_ID";
    const PUBLIC_KEY = "YOUR_PUBLIC_KEY";

    emailjs.sendForm(SERVICE_ID, TEMPLATE_ID, form.current, PUBLIC_KEY)
      .then((result) => {
        console.log("SUCCESS!", result.text);
        setStatus("Message Sent!");
        setTimeout(() => {
          setStatus("Send Inquiry");
          onClose();
        }, 2000);
      })
      .catch((error) => {
        console.error("FAILED...", error);
        setStatus("Error: Check Console");
      });
  };

  return (
    <motion.div 
      initial={{ opacity: 0 }} animate={{ opacity: 1 }} exit={{ opacity: 0 }}
      style={styles.overlay} onClick={onClose}
    >
      <motion.div 
        initial={{ y: 50, opacity: 0, scale: 0.9 }} animate={{ y: 0, opacity: 1, scale: 1 }}
        style={styles.modal} onClick={(e) => e.stopPropagation()} 
      >
        <button onClick={onClose} style={styles.closeBtn}>Ã—</button>
        <div style={styles.header}>
          <h2 style={styles.title}>Contact <span style={{color: '#2ecc71'}}>Us</span></h2>
        </div>

        <form ref={form} style={styles.form} onSubmit={handleContactSubmit}>
          <div style={styles.row}>
            <div style={styles.inputGroup}>
              <label style={styles.label}>Full Name</label>
              <input name="from_name" type="text" placeholder="John Doe" style={styles.input} required />
            </div>
            <div style={styles.inputGroup}>
              <label style={styles.label}>Email Address</label>
              <input name="from_email" type="email" placeholder="john@email.com" style={styles.input} required />
            </div>
          </div>
          <div style={styles.inputGroup}>
            <label style={styles.label}>Message</label>
            <textarea name="message" placeholder="How can we help?" style={{...styles.input, height: '120px'}} required />
          </div>
          <motion.button type="submit" style={styles.submitBtn}>{status}</motion.button>
        </form>
      </motion.div>
    </motion.div>
  );
};

const styles = {
  overlay: { position: 'fixed', top: 0, left: 0, width: '100vw', height: '100vh', background: 'rgba(0,0,0,0.9)', backdropFilter: 'blur(10px)', zIndex: 2000, display: 'flex', justifyContent: 'center', alignItems: 'center' },
  modal: { background: '#111', width: '90%', maxWidth: '600px', borderRadius: '20px', padding: '40px', position: 'relative', border: '1px solid #222' },
  closeBtn: { position: 'absolute', top: '15px', right: '20px', background: 'none', border: 'none', color: '#fff', fontSize: '1.5rem', cursor: 'pointer' },
  header: { textAlign: 'center', marginBottom: '30px' },
  title: { fontSize: '2rem', color: '#fff' },
  form: { display: 'flex', flexDirection: 'column', gap: '15px' },
  row: { display: 'flex', gap: '15px', flexWrap: 'wrap' },
  inputGroup: { flex: 1, display: 'flex', flexDirection: 'column', gap: '5px' },
  label: { color: '#2ecc71', fontSize: '0.75rem', fontWeight: 'bold' },
  input: { background: '#0a0a0a', border: '1px solid #333', padding: '12px', borderRadius: '8px', color: '#fff', outline: 'none' },
  submitBtn: { background: '#2ecc71', color: '#000', border: 'none', padding: '15px', borderRadius: '8px', fontWeight: 'bold', cursor: 'pointer' }
};

export default ContactModal;
